INSERT INTO `page_translations` (`id`, `page_id`, `title`, `content`, `lang`, `created_at`, `updated_at`) VALUES (1,6,'Privacy Policy Page','<h2><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; font-size: 13px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><b>Velburry</b> respect and secure your privacy. Our team committed to assuring the privacy of every customer who visits our website. We use advanced technology and secure privacy protection controls to protect your personal information. If you are just browsing our website, you can do so anonymously. Velburry website does not ask to enter any personal information during your visit unless you place an order for services or decide to log into our customer portal to provide information or receive documents. However, we do not involve and share your personal information to third parties, except as permitted or required by law or as required for specific services as explained in this privacy statement. Further note that Velburry does not share, sell, or lease any personal information collected at our site, including membership forms or e-mail lists. Velburry considers all personal information confidential. If you want to purchase anything from our online shoe store, then don\'t be worried regarding your information. Our talented team members will store your personal data in our database and provide one of our employees to contact you when delivering.</span></p><br style=\"font-size: 13px;\"><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; font-size: 13px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Our standard information security Policy controls helps to prevent unauthorized access to customers personal information. The information that we receive from our beloved customer is mandatory in fulfilling your needs and providing excellent service quality. We will give rights to authorized employees who are trained in the proper handling of customer identification information to have access to your information. Our experts technicians regularly test this secure technology and try to protect the confidentiality of information about you.</span></p><br style=\"font-size: 13px;\"><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; font-size: 13px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;If you have any query or need suggestions regarding our collection, please contact us at +92 300 4192038 or email us at </span><a href=\"sales@velburry.com\">sales@velburry.com</a></p><div><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></div></h2>','en','2021-01-11 01:45:02','2021-01-14 03:17:47'),(2,5,'Term Conditions Page','<h2><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 13px;\">These Terms and Conditions (\"Terms\", \"Terms and Conditions\") govern your relationship with Velburry.com website (the \"Service\") operated by Velburry.com&nbsp;(\"us\", \"we\", or \"our\").</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 13px;\">Please read these Terms and Conditions carefully before using the Service.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 13px;\">Your access to and use of the Service is conditioned on your acceptance of and 