e=\"margin: 1em 0px;\">Delivery time: 2-3 working days</p><p open=\"\" sans\";=\"\" font-size:=\"\" 13px;=\"\" font-weight:=\"\" 400;\"=\"\" style=\"margin: 1em 0px;\">Delivery Charges: Based on overall order weight. Rates are calculated at the time of checkout.</p><br open=\"\" sans\";=\"\" font-size:=\"\" 13px;=\"\" font-weight:=\"\" 400;\"=\"\"></h3><h3 open=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);\"=\"\" style=\"margin-right: 0px; margin-bottom: 5px; margin-left: 0px; font-weight: 700; line-height: 1.35; font-size: 16px;\">Other Cities</h3><h3 open=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);\"=\"\" style=\"margin-right: 0px; margin-bottom: 5px; margin-left: 0px; line-height: 1.35; font-size: 16px;\"><p open=\"\" sans\";=\"\" font-size:=\"\" 13px;=\"\" font-weight:=\"\" 400;\"=\"\" style=\"margin: 1em 0px;\">Delivery time: 2-5 working days</p><p open=\"\" sans\";=\"\" font-size:=\"\" 13px;=\"\" font-weight:=\"\" 400;\"=\"\" style=\"margin: 1em 0px;\">Delivery Charges: Based on overall order weight. Rates are calculated at the time of checkout</p></h3>','en','2021-01-14 03:55:45','2021-01-14 10:53:24'),(8,9,'FAQ','<p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">What is Velburry.com?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">Velburry.com</span>&nbsp;is an e-commerce initiative of&nbsp;<span style=\"font-weight: 700;\">Velburry</span>&nbsp;Supermarket.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">How can I pay for my order?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">You can pay through Cash on Delivery, Visa/Master/UnionPay Credit/Debit Cards, EasyPaisa, KEENU NetConnect and Credit Card on Delivery.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">Can you ship orders nationwide?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">Yes, currently we ship in over 800 cites in Pakistan.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">What are the delivery charges?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">Please visit&nbsp;<a href=\"https://www.naheed.pk/delivery-shipping\" style=\"color: rgb(51, 51, 51); outline: none medium !important;\">Delivery &amp; Shipping</a>&nbsp;page for more information.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">How can I track or check status of my order?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">Order status can be checked from \'My Orders\' screen in your account. Status can also be checked through&nbsp;<a href=\"https://www.naheed.pk/order-tracking\" style=\"color: rgb(51, 51, 51); outline: none medium !important;\">Order Tracking</a>&nbsp;page.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">How can I return a product?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">Please visit&nbsp;<a href=\"https://naheed.pk/returns-and-refunds\" style=\"color: rgb(51, 51, 51); outline: none medium !important;\">Returns &amp; Refunds</a>&nbsp;page for more information.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">Do I have to pay for shipping charges when returning a product?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">No, you don\'t have to pay for shipping charges when returning a product</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">Can I return a product after 7 days?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">You have to initiate a return process within 7 days of delivery. Unfortunately after 7 days, we won\'t be able to accept return request.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">Do you verify orders?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">Yes, before processing any order our customer service team will call you on your mentioned cell phone number to verify order.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">What is the warranty policy?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">Warranty policy varies from vendor to vendor and product to product.&nbsp;<span style=\"font-weight: 700;\">Velburry.com</span>&nbsp;does not offer warranty claims directly. Warranty claims are processed directly through the vendor at their respective service centers.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">Not all products come with a warranty. If the products are available with a warranty then it will be clearly mentioned in the product specification or description.</p>','en','2021-01-14 04:17:31','2021-01-14 04:17:31');
