ity the product must be in its original condition and unworn.<o:p></o:p></span></li><li style=\"margin-left: 0.25in;\"><span style=\"font-size: 16pt; line-height: 24.5333px;\">The packaging (box) and the product must be in an undamaged position. In case of any damage, you wont qualify for the return.<o:p></o:p></span></li><li style=\"margin-left: 0.25in;\"><span style=\"font-size: 16pt; line-height: 24.5333px;\">You must have the invoice for your purchase.<o:p></o:p></span></li></ul><p class=\"MsoNormal\"></p><ul style=\"margin-bottom: 1rem;\"><li style=\"margin-left: 0.25in;\"><span style=\"font-size: 16pt; line-height: 24.5333px;\">If our product doesnt satisfy you fully for any reason you can simply ask for a return by contacting us on +92 300 4192038 Or login to your account on our website and ask at our online support.<o:p></o:p></span></li></ul><p class=\"MsoNormal\"><span style=\"font-weight: bolder;\"><span style=\"font-size: 20pt; line-height: 30.6667px;\"><o:p></o:p></span></span></p><p style=\"text-indent: -0.25in;\"><br></p><p class=\"MsoNormal\"><span style=\"font-weight: bolder;\"><span style=\"font-size: 20pt; line-height: 30.6667px;\">Return in Sale and promotion days:<o:p></o:p></span></span></p><p class=\"MsoNormal\"><span style=\"font-size: 16pt; line-height: 24.5333px;\">Please note, our return policy doesnt work during the promotion or sale period. Your return request will be processed after the end of the promotion of the sale period. During this period the return may take 3-5 working days.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-weight: bolder;\"><span style=\"font-size: 20pt; line-height: 30.6667px;\">Faulty/damaged products:<o:p></o:p></span></span></p><p class=\"MsoNormal\"><span style=\"font-size: 16pt; line-height: 24.5333px;\">If you receive a damaged, faulty, or wrong sized item, then please contact us online through our website or our contact number. You can also send back the parcel from your drop step by the de