g into our customer portal to provide information or receive documents. However, we do not involve and share your personal information to third parties, except as permitted or required by law or as required for specific services as explained in this privacy statement. Further note that Velburry does not share, sell, or lease any personal information collected at our site, including membership forms or e-mail lists. Velburry considers all personal information confidential. If you want to purchase anything from our online shoe store, then don\'t be worried regarding your information. Our talented team members will store your personal data in our database and provide one of our employees to contact you when delivering.</span></p><br style=\"font-size: 13px;\"><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; font-size: 13px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Our standard information security Policy controls helps to prevent unauthorized access to customers personal information. The information that we receive from our beloved customer is mandatory in fulfilling your needs and providing excellent service quality. We will give rights to authorized employees who are trained in the proper handling of customer identification information to have access to your information. Our experts technicians regularly test this secure technology and try to protect the confidentiality of information about you.</span></p><br style=\"font-size: 13px;\"><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; font-size: 13px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;If you have any query or need suggestions regarding our collection, please contact us at +92 300 4192038 or email us at </span><a href=\"sales@velburry.com\">sales@velburry.com</a></p><div><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></div></h2>',NULL,NULL,NULL,NULL,'2020-11-04 10:15:55','2021-01-14 03:17:47'),(7,'custom_page','Delivery and Shipping','deliveryandshipping','<h3 open=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);\"=\"\" style=\"margin-right: 0px; margin-bottom: 5px; margin-left: 0px; font-weight: 700; line-height: 1.35; font-size: 16px;\">Faisalabad</h3><h3 open=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);\"=\"\" style=\"margin-right: 0px; margin-bottom: 5px; margin-left: 0px; line-height: 1.35; font-size: 16px;\"><p open=\"\" sans\";=\"\" font-size:=\"\" 13px;=\"\" font-weight:=\"\" 400;\"=\"\" style=\"margin: 1em 0px;\">Delivery Time: 24-48 Hours</p><p style=\"margin: 1em 0px;\">Delivery Charges: Rs. 99 per order</p><p open=\"\" sans\";=\"\" font-size:=\"\" 13px;=\"\" font-weight:=\"\" 400;\"=\"\" style=\"margin: 1em 0px;\"><br></p></h3><h6><b>Toba - Gojra - Jhang - Chiniot - Samundri&nbsp; - Jaranwala.</b></h6><h3 open=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);\"=\"\" style=\"margin-right: 0px; margin-bottom: 5px; margin-left: 0px; line-height: 1.35; font-size: 16px;\"><p open=\"\" sans\";=\"\" font-size:=\"\" 13px;=\"\" font-weight:=\"\" 400;\"=\"\" style=\"margin: 1em 0px;\">Delivery Time: Next working day</p><p open=\"\" sans\";=\"\" font-size:=\"\" 13px;=\"\" font-weight:=\"\" 400;\"=\"\" style=\"margin: 1em 0px;\">Delivery Charges: Rs. 99 per order</p><br open=\"\" sans\";=\"\" font-size:=\"\" 13px;=\"\" font-weight:=\"\" 400;\"=\"\"></h3><h3 open=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);\"=\"\" style=\"margin-right: 0px; margin-bottom: 5px; margin-left: 0px; font-weight: 700; line-height: 1.35; font-size: 16px;\">Lahore, Islamabad &amp; Peshawar</h3><h3 open=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);\"=\"\" style=\"margin-right: 0px; margin-bottom: 5px; margin-left: 0px; line-height: 1.35; font-size: 16px;\"><p open=\"\" sans\";=\"\" font-size:=\"\" 13px;=\"\" font-weight:=\"\" 400;\"=\"\" style=\"margin: 1em 0px;\">Delivery time: 2-3 working days</p><p open=\"\" sans\";=\"\" font-size:=\"\" 13px;=\"\" font-weight:=\"\" 400;\"=\"\" style=\"margin: 1em 0px;\">Delivery Charges: Based on overall order weight. Rates are calculated at the time of checkout.</p><br open=\"\" sans\";=\"\" font-size:=\"\" 13px;=\"\" font-weight:=\"\" 400;\"=\"\"></h3><h3 open=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);\"=\"\" style=\"margin-right: 0px; margin-bottom: 5px; margin-left: 0px; font-weight: 700; line-height: 1.35; font-size: 16px;\">Other Cities</h3><h3 open=\"\" sans\",=\"\" sans-serif;=\"\" color:=\"\" rgb(102,=\"\" 102,=\"\" 102);\"=\"\" style=\"margin-right: 0px; margin-bottom: 5px; margin-left: 0px; line-height: 1.35; font-size: 16px;\"><p open=\"\" sans\";=\"\" font-size:=\"\" 13px;=\"\" font-weight:=\"\" 400;\"=\"\" style=\"margin: 1em 0px;\">Delivery time: 2-5 working days</p><p open=\"\" sans\";=\"\" font-size:=\"\" 13px;=\"\" font-weight:=\"\" 400;\"=\"\" style=\"margin: 1em 0px;\">Delivery Charges: Based on overall order weight. Rates are calculated at the time of checkout</p></h3>',NULL,NULL,NULL,NULL,'2021-01-14 03:55:45','2021-01-14 10:53:24'),(9,'custom_page','FAQ','FAQ','<p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">What is Velburry.com?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">Velburry.com</span>&nbsp;is an e-commerce initiative of&nbsp;<span style=\"font-weight: 700;\">Velburry</span>&nbsp;Supermarket.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">How can I pay for my order?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">You can pay through Cash on Delivery, Visa/Master/UnionPay Credit/Debit Cards, EasyPaisa, KEENU NetConnect and Credit Card on Delivery.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">Can you ship orders nationwide?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">Yes, currently we ship in over 800 cites in Pakistan.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">What are the delivery charges?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">Please visit&nbsp;<a href=\"https://www.naheed.pk/delivery-shipping\" style=\"color: rgb(51, 51, 51); outline: none medium !important;\">Delivery &amp; Shipping</a>&nbsp;page for more information.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">How can I track or check status of my order?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">Order status can be checked from \'My Orders\' screen in your account. Status can also be checked through&nbsp;<a href=\"https://www.naheed.pk/order-tracking\" style=\"color: rgb(51, 51, 51); outline: none medium !important;\">Order Tracking</a>&nbsp;page.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">How can I return a product?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">Please visit&nbsp;<a href=\"https://naheed.pk/returns-and-refunds\" style=\"color: rgb(51, 51, 51); outline: none medium !important;\">Returns &amp; Refunds</a>&nbsp;page for more information.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">Do I have to pay for shipping charges when returning a product?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">No, you don\'t have to pay for shipping charges when returning a product</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">Can I return a product after 7 days?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">You have to initiate a return process within 7 days of delivery. Unfortunately after 7 days, we won\'t be able to accept return request.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">Do you verify orders?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">Yes, before processing any order our customer service team will call you on your mentioned cell phone number to verify order.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\"><span style=\"font-weight: 700;\">What is the warranty policy?</span></p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">Warranty policy varies from vendor to vendor and product to product.&nbsp;<span style=\"font-weight: 700;\">Velburry.com</span>&nbsp;does not offer warranty claims directly. Warranty claims are processed directly through the vendor at their respective service centers.</p><p style=\"margin: 1em 0px; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;;\">Not all products come with a warranty. If the products are available with a warranty then it will be clearly mentioned in the product specification or description.</p>',NULL,NULL,NULL,NULL,'2021-01-14 04:17:31','2021-01-14 04:17:31');
